import React, { useState } from 'react'

function Prop1() {

    const initialobj={
        firstname:'',
        secondname:''
}
    const [user,setUser]=React.useState(initialobj)
    const [userlist,setUserlist]=React.useState([]);


   const handleinput=(event)=>{
        setUser({...user,[event.target.name]:event.target.value})
 }
    const savedata=()=>{
      setUserlist([...userlist,user])
        document.getElementById('myform').reset()
        setUser(initialobj)
    }
  return (
    <div>
    <h2>hello</h2>

    <form id='myform'>
    <label>First Name:</label>
    <input type='text' name='firstname' onChange={handleinput}/>

    <label>secondname:</label>
    <input type='text' name='secondname' onChange={handleinput} />
    <button type='button' onClick={savedata} >submit</button>

    </form>  
    <UserListDisplay1 userlist={userlist} setUserlist={setUserlist}/>
    </div>

  )
}

function UserListDisplay1(props){
  const deleteUser=(index)=>{
    let temp=[...props.userList]
    temp.splice(index,1)
    props.setUserList(temp)
  }
  return(
    <div>
    <ul>
    {props.userList.map((user,index)=>(
      <div>
      <li>{user.firstname+" "+user.secondname}</li>
      <button type='button' onClick={()=>deleteUser(index)}>delete</button>
      </div>
  ))}
    </ul>
    </div>
  )
}
export default Prop1;
